const pizzaClick = () => console.log('Free pizza!')
const Form = () => {
    return (
        <div className="w-25 p-3" >
            <form>
                <div className="form-group">
                    <label htmlFor="exampleInputEmail1">Nombre de la persona</label>
                    <input type="email" className="form-control" id="name"/>
                </div>
                <button type="submit" className="btn btn-primary" onClick={pizzaClick}>Submit</button>
            </form>
        </div>
    )
}

export default Form
